(377, 'Comedero de plástico.', 'LD899', '<li>Comedero sencillo.</li>\n<li>Elaborado en plástico resistente.</li>\n<li>Superficie lisa de fácil limpieza.</li>\n<li>Colores: Amarillo/Verde/Azul.</li>\n<li>Venta por unidad.</li>\n\n', NULL, 6.50, 22.50, NULL, NULL, 1, '2012-10-31 03:14:51', 0, 0, 1, 1),
(378, 'Comedero de plástico.', 'CF101', '<li>Comedero de plástico sencillo</li>\n<li>Disponible en tres colores: Rosado/Amarillo/Verde</li>\n<li>Plástico resistente, fácil de limpiar.</li>\n<li>Venta por unidad</li>', NULL, 6.50, 22.50, NULL, NULL, 1, '2012-10-30 03:22:55', 0, 0, 1, 1),
(379, 'Comedero de plástico.', 'CF105S', '<li>Comedero de plástico pequeño.</li>\n<li>Forma anatómica.</li>\n<li>Superficie lisa de fácil limpieza.</li>\n<li>Color: Azul.</li>\n<li>Venta por unidad.</li>', NULL, 3.00, 13.50, NULL, NULL, 1, '2012-10-30 03:36:05', 0, 0, 1, 1),
(380, 'Comedero de plástico.', 'CF105M', '<li>Comedero de plástico mediano.</li>\n<li>Forma anatómica.</li>\n<li>Superficie lisa de fácil limpieza.</li>\n<li>Color: Verde.</li>\n<li>Venta por unidad.</li>', NULL, 4.00, 17.00, NULL, NULL, 1, '2012-10-30 03:34:56', 0, 0, 1, 1),
(381, 'Comedero de plástico.', 'CF105L', '<li>Comedero de plástico grande.</li>\n<li>Forma anatómica.</li>\n<li>Superficie lisa de fácil limpieza.</li>\n<li>Color: Negro.</li>\n<li>Venta por unidad.</li>', NULL, 5.00, 22.00, NULL, NULL, 1, '2012-10-30 03:25:05', 0, 0, 1, 1),
(382, 'Pelota tejida para gatos.', 'CT2052', '<li>Pack de 6 pelotas tejidas para gatos.</li>\n<li>Con este juguete conseguirá que su mascota haga ejercicio.</li>\n<li>Garantiza el entretenimiento prolongado de la mascota.</li>\n<li>Diversos colores.</li>', NULL, NULL, NULL, NULL, NULL, 1, '2012-10-30 04:04:03', 0, 0, 2, 10),
(385, 'Cortauñas profesional para perros.', 'Q001A', '<li>Cortauñas profesional.</li>\n<li> Colores:Azul/Rosa.</li>\n<li>Su forma especialmente diseñada permite un corte preciso de manera que las uñas de su mascota se mantendrán siempre cortas.</li>\n<li>Empacado en blister individual.</li>', NULL, NULL, 14.50, NULL, NULL, 1, '2012-10-31 04:23:41', 0, 0, 1, 5),
(386, 'Cepillo de alambre tipo raqueta.', 'GR1467', '<li>Sus finos dientes metálicos están situados de forma tupida para eliminar una gran cantidad de pelo muerto con cada pasada.</li>\n<li>El mango ergonómico y antiresbalante es muy cómodo, permitiendo trabajar con esta herramienta con facilidad y precisión.</li>\n<li>Puede usarse en perros de cualquier tamaño y tipo de pelaje.</li>\n<li>Color: Verde.</li>\n<li>Empacado en blister por unidad.</li>', NULL, 8.50, 16.00, NULL, NULL, 1, '2012-10-30 04:25:15', 0, 0, 1, 5),
(387, 'Cepillo de alambre tipo raqueta.', 'GR1474', '<li>Sus finos dientes metálicos están situados de forma tupida para eliminar una gran cantidad de pelo muerto con cada pasada.</li>\n<li>El mango ergonómico y antiresbalante es muy cómodo, permitiendo trabajar con esta herramienta con facilidad y precisión.</li>\n<li>Puede usarse en perros de cualquier tamaño y tipo de pelaje.</li>\n<li>Color: Rosa.</li>\n<li>Empacado en blister por unidad.</li>', NULL, 8.50, 16.00, NULL, NULL, 1, '2012-10-30 04:25:43', 0, 0, 1, 5),
(388, 'Camas para mascotas.', 'BJ-4227Z', '<li>Set de 5 piezas.</li>\n<li>Espaciosa y cómoda, elaborada con el mejor material.</li>\n<li>Cálida y muy resistente, proporcionando a su mascota un lugar adecuado para descansar.</li>\n<li>Es una pieza fundamental para el descanso de su mascota.</li>', NULL, NULL, NULL, NULL, NULL, 1, '2012-10-30 02:50:17', 0, 0, 1, 16),
(389, 'Camas para mascotas.', 'BJ-4227P', '<li>Set de 5 piezas.</li>\n<li>Espaciosa y cómoda, elaborada con el mejor material.</li>\n<li>Cálida y muy resistente, proporcionando a su mascota un lugar adecuado para descansar.</li>\n<li>Es una pieza fundamental para el descanso de su mascota.</li>', NULL, NULL, NULL, NULL, NULL, 1, '2012-10-30 02:45:03', 0, 0, 1, 16),
(390, 'Camas para mascotas.', 'BJ-4227J', '<li>Set de 5 piezas.</li>\n<li>Espaciosa y cómoda, elaborada con el mejor material.</li>\n<li>Cálida y muy resistente, proporcionando a su mascota un lugar adecuado para descansar.</li>\n<li>Es una pieza fundamental para el descanso de su mascota.</li>', NULL, NULL, NULL, NULL, NULL, 1, '2012-10-30 02:44:11', 0, 0, 1, 16),
(391, 'Comedero flexible.', 'P929', '<li>Excelente diseño que facilita su uso y transporte.</li>\n<li>Elaborado en plástico flexible de alta calidad.</li>\n<li>Ideal para llevar de viaje en la cartera o bolso.</li>\n<li>Color: Amarillo/Azul.</li>\n<li>Venta por unidad.</li>', NULL, 7.00, 29.50, NULL, NULL, 1, '2012-10-31 04:07:18', 0, 0, 1, 1),
(392, 'Comedero de plástico alto.', 'LD504', '<li>Comedero de plástico resistente y de alta calidad.</li>\n<li>Superficie lisa de fácil limpieza.</li>\n<li>Ideal para perros de orejas muy largas.</li>\n<li>Antideslizantes en la base.</li>\n<li>Color: Rosa/Azul.</li>\n<li>Venta por unidad.</li>', 20.00, 12.00, NULL, NULL, NULL, 1, '2012-10-30 05:06:00', 0, 0, 1, 1),
(393, 'Comedero de plástico doble.', 'CF201', '<li>Permite servir alimento y agua simultáneamente.</li>\n<li>Con rosca para colocar botella de agua.</li>\n<li>Elaborado en plástico resistente.</li>\n<li>Color:Azul/Amarillo.</li>\n<li>Venta por unidad.</li>', NULL, NULL, NULL, NULL, NULL, 1, '2012-10-30 03:37:03', 0, 0, 1, 1),
(394, 'Comedero de plástico.', 'P788', '<li>Comedero de plástico resistente.</li>\n<li>Goma antideslizante en la base.</li>\n<li>Diseño exclusivo.</li>\n<li>Disponible en varios colores.</li>\n<li>Venta por unidad.</li>', NULL, 4.50, 21.00, NULL, NULL, 1, '2012-10-31 04:01:14', 0, 0, 1, 1),
(395, 'Paseador extensible con brillantes.', 'WL001DB', '<li>Paseador extensible para perros.</li>\n<li>Elaborados con detalles de brillantes.</li>\n<li>Asa de goma para mejor agarre.</li>\n<li>3 mts. de longitud.</li>\n<li>Soporta hasta 20kg.</li>\n<li>Color: Azul/Rosado.</li>', NULL, NULL, NULL, NULL, NULL, 1, '2012-11-01 04:37:19', 0, 0, 1, 4),
(396, 'Juguete lanzador de pelotas.', 'PS-08C', '<li>Garantiza horas de entretenimiento para su mascotas.</li>\n<li>Permite lanzar y recoger la pelota sin necesidad de agacharse.</li>\n<li>Este juguete contribuye a que la mascota haga ejercicio.</li>\n<li>Hecho de un material duradero y resistente.</li>\n<li>Venta por unidad.</li>', NULL, NULL, NULL, NULL, NULL, 1, '2012-10-31 04:22:34', 0, 0, 1, 2),
(397, 'Juguete mordedor pequeño.', 'P935', '<li>Duro, fuerte y resistente.</li>\n<li>Cuidan la salud dental del perro.</li>\n<li>Diseñado para satisfacer el instinto de morder de perros.</li>\n<li>Con extremo de mecate para la limpiar los dientes de la mascota.</li>\n<li>Venta por unidad.</li>\n<li>Color: Amarillo/Azul.</li>', NULL, NULL, NULL, NULL, NULL, 1, '2012-11-06 05:07:22', 0, 0, 1, 3),
(398, 'Juguete mordedor pequeño.', 'P930', '<li>Duro, fuerte y resistente.</li>\n<li>Diseñado para satisfacer el instinto de morder de perros.</li>\n<li>Con extremo de mecate para la limpiar los dientes de la mascota.</li>\n<li>Con cascabel incluido.</li>\n<li>Venta por unidad.</li>\n<li>Color: Amarillo/Rosa.</li>', NULL, NULL, NULL, NULL, NULL, 1, '2012-11-06 05:08:11', 0, 0, 1, 3),
(399, 'Hueso de vinyl con relieve.', 'VT2720', '<li>Fabricada de material no tóxico.</li>\n<li>El sonido que se produce al apretarla agrega atractivo a este juguete.</li>\n<li>Es de material blando por lo que es perfecto para cachorros y perros en general.</li>\n<li>Es un juguete que proporcionará horas de diversión y entretenimiento a tu mascota.</li>\n<li>Colores llamativos</li>\n<li>Empacado por unidad.</li>', NULL, 5.00, 14.00, NULL, NULL, 1, '2012-11-01 04:32:48', 0, 0, 1, 3),
